import React from "react";
import "./LastSensors.scss";
import { RootState } from "../../../types/interfaces";
import { useSelector } from "react-redux";

function LastSensors() {
  const sensors = useSelector((state: RootState) => state.containers);
  console.log("sensors", sensors);

  return (
    <div>
      <h2>Last Sensors</h2>
      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Датчик ID</TableCell>
              <TableCell>Другие данные</TableCell>
              <TableCell>Заполнение</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {sensors.map((sensor) => (
              <TableRow key={sensor.id}>
                <TableCell>{sensor.id}</TableCell>
                {/* Добавьте другие данные сенсора здесь */}
                <TableCell
                  style={{
                    backgroundColor: getColor(sensor.capacity, sensor.filled),
                  }}
                >
                  {getFillPercentage(sensor.capacity, sensor.filled)}%
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
}

export default LastSensors;
